import React from 'react';

const History = ({ history }) => (
  <div
    style={{
      position: 'absolute',
      top: 50,
      right: 10,
      width: 200,
      maxHeight: '100vh',
      overflowY: 'auto',
      background: 'rgba(255,255,255,0.97)',
      borderLeft: '1px solid #ccc',
      boxShadow: '-2px 0 8px rgba(0,0,0,0.07)',
      zIndex: 2000,
      fontSize: 13,
      padding: 12,
    }}
  >
    <h3 style={{ marginTop: 0 }}>History</h3>
    {history.length === 0 && <div style={{ color: '#888' }}>No actions yet.</div>}
    <ol style={{ paddingLeft: 20 }}>
      {history.map((item, idx) => (
        <li key={idx} style={{ marginBottom: 10 }}>
          <div>
            <strong>Type:</strong> {item.type}
          </div>
          <div>
            <strong>Feature ID:</strong> {item.featureId ? item.featureId.toString() : 'N/A'}
          </div>
          {'index' in item && (
            <div>
              <strong>Index:</strong> {item.index}
            </div>
          )}
          {/* <div>
            <strong>Prev Coords:</strong>
            <pre style={{ margin: 0, background: '#f7f7f7', fontSize: 11, overflowX: 'auto' }}>
              {JSON.stringify(item.prevCoords, null, 2)}
            </pre>
          </div>
          <div>
            <strong>New Coords:</strong>
            <pre style={{ margin: 0, background: '#f7f7f7', fontSize: 11, overflowX: 'auto' }}>
              {JSON.stringify(item.newCoords, null, 2)}
            </pre>
          </div> */}
        </li>
      ))}
    </ol>
  </div>
);

export default History;
